import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <>
    <h1>Netflix top 5 series</h1>
    <p>Here is list of best 5 series :</p>
    <ul>
      <li>Stranger Things</li>
      <li>The Crown</li>
      <li>The Witcher</li>
      <li>Money Heist</li>
      <li>Dark</li>
    </ul>
  </>
);
